function ArrToURI(arr) {
	var s='';
	if (typeof arr != 'undefined' && arr !='') {
		for (var i = 0; i < arr.length; i++) {
			for (var key in arr[i]) {
				s=s+'cached['+i+']['+key+']='+arr[i][key]+'&';
			}
		}
	}
	return s;
}

