function unique_gifts(arr) {  
     var ret = [arr[0]] , q = 1;  
     for (var i = 1; i < arr.length; i++) { // start loop at 1 as element 0 can never be a duplicate  
         if (arr[i-1].gift_name !== arr[i].gift_name) {  
		ret.push(arr[i]);  
		var len = eval ( ret.length - 2) ;
		ret[len].quantity=q;
		q = 1 ;
         }  else q++ ;
     }  

//final loop end
	var len = eval ( ret.length - 1) ;
	ret[len].quantity=q;

     return ret;  
//	a=unique_gifts(a);
 }  


