function Match(text, pattern){
	var m = text.match(pattern);
	if (m == null) 
		return null;
	return m[1];
}

function gup( name, res )
{
  name = name.replace(/[\[]/,"\\\[").replace(/[\]]/,"\\\]");
  var regexS = "[\\?&]"+name+"=([^&#]*)";
  var regex = new RegExp( regexS );
  var results = regex.exec( res );
  if( results == null )
    return "";
  else
    return results[1];
}

function myURLencode(url) {
	u = url;
	u = u.replace(/_/g, '%5F')
	u = u.replace(/,/g, '%2C')
	u = u.replace(/ /g, '%20')
	u = u.replace(/\./g, '%2E')
	u = u.replace(/\[/g, '%5B')
	u = u.replace(/\]/g, '%5D')
	//alert(u);
	return u;
}
