function get_contracts() {
	//GM_log(JSON.stringify(mode_flags));
	if (mode_flags.get_contracts != true) {
		mode_flags.get_contracts=true;
		getxmlall();
		return;
	}
	mode_flags.get_contracts=false;
	
	$('#contracts_area').html('');
	//var s='';for (key in $('#contracts_area')) {s=s+key+' ';};GM_log(s);
	for(var i=0;i<factories.length;i++) {
		$('#contracts_area').append(factories[i].desc+' : ');
		if (factories[i].state == 2) {$('#contracts_area').append('простаивает');}
		if (factories[i].state == 3 && factories[i].fill != -1) {$('#contracts_area').append('работает, контракт - "'+find_item_desc_by_id(factories[i].fill)+'" завершится через '+my_print_time(factories[i].process_end/1000));}
		if (factories[i].state == 4 && factories[i].fill != -1) {$('#contracts_area').append('завершен, контракт - "'+find_item_desc_by_id(factories[i].fill)+'" испортится через '+my_print_time(factories[i].process_end/1000));}
		if (factories[i].state == 5) {$('#contracts_area').append('грязный');}
		if (factories[i].state == 6 && factories[i].fill != -1) {$('#contracts_area').append('испорчен, контракт - "'+find_item_desc_by_id(factories[i].fill)+'"');}
		$('#contracts_area').append('.\n');
	}
	$('#combo_factory').empty();
	$('#combo_factory').append('<option value=""></option>');
	for(var i=0;i<factories.length;i++){
		$('#combo_factory').append('<option value="'+factories[i].id+'">'+factories[i].desc+'</option>');
	};
	$('#div_factory_action').show(); 
}

function renew_factory_contracts() {
	var factory=document.getElementById('combo_factory').value ;
	document.getElementById('combo_factory_action').value='';
	$('#combo_factory_contract').empty();
	if (factory=='') return;
	var factory_num;
	for(var i=0;i<factories.length;i++){
		if (factories[i].id==factory) {factory_num=factories[i].num;}
	}
	var contracts = find_contracts_by_id(factory_num);
	
	$('#combo_factory_contract').append('<option value=""></option>');
	for(i=0;i<contracts.length;i++) {
		$('#combo_factory_contract').append('<option value="'+contracts[i].name+'">'+find_item_desc_by_name(contracts[i].name)+'</option>');
	};
}

function renew_contract_details() {
	var factory=document.getElementById('combo_factory').value ;
	var contract=document.getElementById('combo_factory_contract').value ;
	document.getElementById('combo_factory_action').value='';
	
	$('#div_contract_details').empty();
	if (factory=='' || contract=='') return;
	var factory_num;
	for(var i=0;i<factories.length;i++){
		if (factories[i].id==factory) {factory_num=factories[i].num;}
	}
	var contracts = find_contracts_by_id(factory_num);
	//GM_log(JSON.stringify(contracts));
	
	for(i=0;i<contracts.length;i++) {
		if (contract == contracts[i].name) {
			var prib = (contracts[i].cash_out-contracts[i].cash);
			if (prib < 0) {prib=prib*(-1);}
			$('#div_contract_details').append('<table><tr><th align=right>Прибыль:<td align=left>'+prib+'<tr><th align=right>Прибыль/час:<td align=left>'+Math.floor(prib/(contracts[i].time/60/60))+'<tr><th align=right>Опыт:<td align=left>'+contracts[i].exp+'<tr><th align=right>Опыт/час:<td align=left>'+Math.floor(contracts[i].exp/(contracts[i].time/60/60))+'<tr><th align=right>Время:<td align=left>'+my_print_time(contracts[i].time)+'</table>');
		}
	};
}

