function run_factory_command() {
	var factory=document.getElementById('combo_factory').value ;
	var contract=document.getElementById('combo_factory_contract').value ;
	var action=document.getElementById('combo_factory_action').value ;
	var state=0;
	for(var i=0;i<factories.length;i++){
		if (factories[i].id==factory) {state=factories[i].state;}
	}
	if (action == 'run' && state==2) {
		go_factory_command(factory,'put',contract);
	}
	if (action == 'get' && state==4) {
		go_factory_command(factory,'pick','');
	}
	if (action == 'cancel' && (state==6 || state==3)) {
		go_factory_command(factory,'pick','');
		if (state==6) {go_factory_command(factory,'clean','');}
	}
	if (action == 'clean' && state==5) {
		go_factory_command(factory,'clean','');
	}
	document.getElementById('combo_factory_action').value='';
}

