function my_print_time(t) {
	var days=0,hours=0,mins=0;
	days=Math.floor(t/60/60/24);
	t=t-days*24*60*60;
	hours=Math.floor(t/60/60);
	t=t-hours*60*60;
	mins = Math.floor(t/60);
	t=t-mins*60;
	var s='';
	if (days > 0) {s+=days+'д';}
	if (hours > 0) 
		if (s == '') {s+=hours+'ч';} else {s+=', '+hours+'ч';}
	if (mins > 0) 
		if (s == '') {s+=mins+'м';} else {s+=', '+mins+'м';}
	if (t > 0) 
		if (s == '') {s+=t+'с';} else {s+=', '+t+'с';}
	//s= t+" "+s;
	return s;
}

